import { Container, Group } from "@mantine/core";
import { Link } from "react-router-dom";

const Footer = () => {
  return (
    <Container size="xl">
      <Group>
        <Link to="/contact">Contact</Link>
        <Link to="/terms-and-conditions">Terms And Conditions</Link>
      </Group>
    </Container>
  );
};

export default Footer;
